import React from "react";
import "./StoryReel.css";
import Story from "./Story";

function StoryReel(){
  return <div className="storyReel">
    <Story
        // image="https://mk0laterblogouwugirk.kinstacdn.com/wp-content/uploads/2019/01/How-Often-Post-to-Facebook-Stories.png"
        image="/logo.png"
        profileSrc="/logo.png"
        title="Hao"
    />
  </div>
}

export default StoryReel;
